import React from 'react';

function Sidebar() {
  const menuItems = [
    { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/9d47167c648b08011457fb8422c23ccb0faf5e34a75cfbc99d35d21986eda059?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82", label: "Dashboard", active: true },
    { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/e5cb9e928db17c33dce2e1ad7079e7a4bccbda4a3aa219111a3096dc910c1db3?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82", label: "Add/Manage Doctor's" },
    { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/ba35dadaadfd93ef4f8883dffa15f20a687819f4a7729e9efaf6400b5c860ce7?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82", label: "Add/Manage Facilities" }
  ];

  return (
    <nav className="flex flex-col pt-5 pr-px mt-0 max-w-full bg-white border-r border-solid min-h-[916px] pb-[688px] w-[289px] max-md:pb-24 max-md:mt-0">
      <ul className="flex flex-col w-full">
        {menuItems.map((item, index) => (
          <li key={index} className={`flex gap-3 items-center py-3.5 pr-10 pl-9 w-full ${item.active ? 'bg-violet-50 border-r-4 border-solid border-r-indigo-500' : ''} min-w-[288px] max-md:px-5`}>
            <img 
              loading="lazy" 
              src={item.icon} 
              alt="" 
              className="object-contain w-6 aspect-square" 
            />
            <span className="self-stretch my-auto text-base font-thin leading-6 text-neutral-600">
              {item.label}
            </span>
          </li>
        ))}
      </ul>
    </nav>
  );
}

export default Sidebar;
